sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var tablelist = [] ;
var grQa = new GlideRecord("question_answer");
var grqaEnQuery = 'sys_class_name=question_answer^table_name=' + inputs.tablename + '^table_sys_id=' + inputs.tablesysid
grQa.addEncodedQuery(grqaEnQuery);
grQa.query();
while (grQa.next()) { 
  tablelist = grQa.value.toString().split(",");
}
outputs.variableobj = grQa;
outputs.tablelist = tablelist;
})(inputs, outputs);

